import MainBackground from "../components/MainBackround";
import { Routes, Route } from "react-router-dom";
import UkrainianMainPage from "../components/UkrainianMainPage";
function MainPage(){
    return (
      <MainBackground>
        <Routes>
          <Route path="/ukrainian" element={UkrainianMainPage}></Route>
        </Routes>
      </MainBackground>
    );
}
export default MainPage;
